import React from 'react';
import '../styles/Footer.css';

function Footer({ currentPage, handlePageChange }) {
  return (
    <footer>



      <div class="contact">
        <span class="email"><a href="mailto:corneliabherman@gmail.com">corneliabherman@gmail.com</a></span>
        <a href="https://github.com/cormillionaire">Github</a>
        <a href="https://www.linkedin.com/in/cornelia-herman/">LinkedIn</a>
        <a href="./assets/images/CorneliaHermanResume.pdf"><i class="bi bi-file-earmark-person"></i></a>
      </div>
      <p>Created by Cornelia 2021</p>
      <p class="separator">|</p>
      <p>Updated Dec 2021</p>
    </footer>
  );
}

export default Footer;
